import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import Serie, { generarNumero } from './componentes/serie.js';



const handleClickSiguiente = () => {
  generarNumero();
  ReactDOM.render(<App />, document.getElementById('root1'));
ReactDOM.render(<App />, document.getElementById('root2'));
ReactDOM.render(<App />, document.getElementById('root3'));
ReactDOM.render(<App />, document.getElementById('root4'));
};

const ButtonSiguiente = document.getElementById("siguiente");
ButtonSiguiente.addEventListener('click', handleClickSiguiente);
